import "./App.css";
import { Fragment } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import GalleryPage from "./Pages/GalleryPage"
import UploadPage from "./Pages/UploadPage";

function App() {
  return (
    <Fragment>
      <Router>
        <Switch>
          <Route exact path="/">
          <UploadPage />
          </Route>
          <Route exact path="/Gallery">
            <GalleryPage />

          </Route>
        </Switch>
      </Router>
    </Fragment>
  );
}

export default App;
